      "description": "<p>Enfocate en lo importante</p><p>El novedoso sistema operativo Android 10 incorpora respuestas inteligentes y acciones sugeridas para todas tus aplicaciones. Además, incluye la función de Bienestar Digital y el Tema Oscuro, para que evites distracciones y logres una mayor concentración.</p><br><p>Capacidad y eficiencia</p><p>Con su potente procesador y memoria RAM de 6 GB, tu equipo alcanzará un alto rendimiento, con gran velocidad de transmisión de contenidos. ¡Ejecutá múltiples aplicaciones a la vez sin demoras!</p><br><p>Más para ver</p><p>Con su pantalla IPS de 6.4\", disfrutá de colores intensos y mayor nitidez en todos tus contenidos.</p><br><p>Gran capacidad de almacenamiento</p><p>Con su memoria interna de 128 GB podrás almacenar archivos y aplicaciones de gran tamaño sin necesidad de subirlos a la nube. Disfrutá de tus contenidos favoritos en todo momento.</p><br><p>Batería superior</p><p>¡Desenchufate! Con la súper batería de 4200 mAh, tendrás energía por mucho más tiempo para jugar, ver series o trabajar sin necesidad de recargar tu teléfono.</p><br><p>Fotografía profesional en tu bolsillo</p><p>Descubrí infinitas posibilidades para tus fotos con las 4 cámaras principales de tu equipo. Gracias a la cámara teleobjetivo capturarás detalles casi imperceptibles, con la de ángulo amplio sacarás fotos nítidas y la ultra gran angular te permitirá obtener imágenes panorámicas excepcionales. ¿Amás los fondos difuminados? Vas a conseguirlos con el famoso modo retrato de la cuarta cámara.</p><br><p>Además, el dispositivo cuenta con cámara frontal de 16 Mpx para que puedas sacarte divertidas selfies o hacer videollamadas.</p><br><p>Tecnología premium</p><p>Maximizá tu seguridad y asegurate de que solo vos puedas desbloquear el equipo. Gracias al sensor de huella dactilar, podrás habilitar tu dispositivo con solo un toque. Además, cuenta con reconocimiento facial que se activa rápidamente al colocar la pantalla frente a tu rostro.</p><br><p>Viene con funda transparente y ya tiene preinstalado muchas app que pertenecen a los servicios de Google</p><br>",
